Adding filtering to my mongodb while using find() in express routing possible? and how?<p>Hello i have this GET function thats using async which finds the specific "Category" mongoose Schema the user just clicked  and another "Tool" mongoose 
Schema (which just finds all the tools in my database)and transports them both to a rendered page. </p>

<p>i was wandering if theres a way to add some sort of filtering to my Tool.find so it will find for example only the tools which have the same category proprety (Tool.category) as the Category (Category.name) the user just clicked? </p>

<p>the GET function: </p>

<pre><code>router.get("/catalog/:id", function (req, res, next) {
    let output = {
            category: [],
            tools: []
    };
    async.parallel([
            function (cb) {
                    Category.findById(req.params.id).exec(function (err, foundCategory) {
                            if (err || !foundCategory) {
                                    req.flash("error", "No category found.");
                                    return res.redirect("back");
                            } else {
                                    output.category = foundCategory;
                                    cb(null, foundCategory);
                            }
                    });
            },
            function (cb) {
                    Tool.find({}, function (err, foundTools) {
                            if (err || !foundTools) {
                                    req.flash("error", "No tools were found.");
                                    return res.redirect("back");
                            } else {
                                    output.tools = foundTools;
                                    cb(null, foundTools);
                            }
                    });
            }
    ], function done(err, results) {
            if (err) {
                    res.json(err.message);
            } else {
                    res.render("tools/catalog-items", {
                            category: output.category,
                            tools: output.tools
                    });
            }
    });
</code></pre>

<p>});</p>

