Aggregation with min and max of different fields, incl. output<p>I hope you can help me with a problem, one of my first posts, so please bear with me, I do my best.</p>

<p>Given following data in db.offers</p>

<pre><code>{ departement : 'C_TG', type : 'FLAT_1', offer: 500, req: 490 }
{ departement : 'C_TG', type : 'FLAT_1', offer: 600, req: 595 }
{ departement : 'F_TG', type : 'FLAT_1', offer: 600, req: 480 }
{ departement : 'C_TG', type : 'FLAT_7', offer: 900, req: 889 }
{ departement : 'C_TG', type : 'FLAT_1', offer: 460, req: 454 }
{ departement : 'F_TG', type : 'FLAT_4', offer: 600, req: 590 }
{ departement : 'C_TG', type : 'FLAT_4', offer: 601, req: 599 }
{ departement : 'D_TG', type : 'FLAT_1', offer: 422, req: 420 }
{ departement : 'D_TG', type : 'FLAT_7', offer: 600, req: 500 }
</code></pre>

<p>I would like to aggregate the data to get the lowest offer and highest request (req) for a specific type, <strong>including the departement (!!)</strong> which is responsible. 
Example result:</p>

<pre><code>{ type: 'FLAT_1' offer: 422, offer_departement: 'D_TG', req: 595, req_departement: 'F_TG' }
{ type: 'FLAT_4' offer: 600, offer_departement: 'F_TG', req: 599, req_departement: 'C_TG' }
{ type: 'FLAT_7' offer: 600, offer_departement: 'D_TG', req: 889, req_departement: 'C_TG' }
</code></pre>

<p>Up to now my best result was something like</p>

<pre><code>[ { _id: { type: "FLAT_1", offer_departement: "D_TG" }, req: 595 } ]
</code></pre>

<p>But here all info regarding the "request info" was missing, so it doesnt really make sense ..
I already grouped and sorted, also did multiple group stages and so on, but either I get a whole list of items not taking the "$min" in account, or I am unable to get the departement into offer_departement...</p>

<p>My most current approach before I decided to ask for help is</p>

<pre><code>db.prices.aggregate ([
        {
            $match : {
                offer : {
                    $ne : "0",
                },
                request : {
                    $ne : "0",
                },
            }
        },
        {
            $group : {
                _id : {
                    type : '$type',
                    dep : '$departement',
                },
                offer : {
                    $min : '$offer',
                },
                request : {
                    $max : '$req',
                }
            }
        },
