Manually distribute unique string identifiers to mongoDB records with mongoose and checking for duplicates<p>I'm trying to develop a system in MEAN stack which should contain a Card model stored in my DB. This model should have two unique fields, the object ID and the card code which will be an alphanumeric string with 8 characters length. My schema is similar to:</p>

<pre><code>var cardSchema = new Schema({
  cod: {type: String, required: true, unique: true},
  titular: {type: String, required: true, index: true},
  balance: {type: Number, default: 500, min: 0, max: 500, required: true},
  lastCredited: {type: Date, default: Date.now(), required: true}
})
</code></pre>

<p>And then i was creating my objects like:</p>

<p>cards.js: post create/</p>

<pre><code>router.post('/create', function(req, res) {
  let card = new Card()
  card.cod = Card.generateCod()
  card.credit()
  if (/^[a-zA-Z\s]+$/.test(req.body.titular)) {
    card.titular = req.body.titular.toUpperCase()
  }
  else{
    res.status(406).send('Invalid name for titular')
    return
  }
  card.save(function (err, result) {
    if(err) res.status(406).send(err)
    else res.status(200).send(result)
  })
})
</code></pre>

<p>My static method generateCod was responsible for distributing the random string code to the cards:</p>

<pre><code>cardSchema.statics.generateCod = function(){
  let possible = "ABCDEFGHIJ0123456789"
  let cod = ''

  for (var i = 0; i &lt; 8; i++) cod += possible.charAt(Math.floor(Math.random() * possible.length))
  return cod
}
</code></pre>

<p>However, in order to avoid duplicated codes, i was searching for some way to check if the generated code was already in use, and then in the positive case i would generate another one and repeat the process, in the negative case i would simply return the code. The solution i found was sending a query to the DB passing my code as a param and checking the length of the response, should the length be equal to 0, it meant that the code was unique. So far so good, the problem is, since my query happens asynchronously to the code, i can't simply use a while or a for loop to check whether the code is unique and break the loop when it is, cause the break would not work and the loop would keep going forever. I actually tried it like this:</p>

<pre><code>while(true){
  for (var i = 0; i &lt; 8; i++) cod += possible.charAt(Math.floor(Math.random() * possible.length))
  Card.find({cod: cod}, function(err, result) {
      if(result.length === 0) break
  })
}
return cod
</code></pre>

<p>I also tried:</p>

<pre><code>while(true){
  for (var i = 0; i &lt; 8; i++) cod += possible.charAt(Math.floor(Math.random() * possible.length))
  Card.find({cod: cod}, function(err, result) {
      if(result.length === 0) return cod
